// - Item 3
```

```ts
const doc = tempo()
 .codeBlock(`
const x = 10;

console.log(x);
  `.trim(),
  'javascript'
 )
 .toString();
// Output:
// ```

javascript
// const x = 10;
//
// console.log(x);
//

```ts
const doc = tempo()
  .frontmatter({ title: 'Hello, World!' })
  .h1('Hello, World!')
  .toString();
// Output:
// ---
// title: Hello, World!
// ---
// # Hello, World!

@param value A JSON object to convert to YAML frontmatter.
@returns The TempoDocument instance with the frontmatter appended to the document.

