```ts
const doc = tempo()
 .h1('Hello, World!')
 .paragraph('This is a paragraph of text.')
 .toJSON();
// Output:
// [
//   {
//     "type": "heading",
//     "data": {
//       "level": 1,
//       "nodes": [
//         {
//           "type": "plaintext",
//           "data": "Hello, World!",
//           "computed": "Hello, World!"
//         }
//       ]
//     },
//     "computed": "# Hello, World!"
//   },
//   {
//     "type": "paragraph",
//     "data": {
//       "nodes": [ ... ],
//     },
//     "computed": "This is a paragraph of text."
//   }
// ]
```

